import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the "Your Profile" link to dynamically load the profile content
    // We use .first() because there are multiple links with the same text
    await page.getByText('Your Profile').first().click();

    // Wait for the profile header to be visible, indicating the content has loaded
    await page.waitForSelector('.profile-header');

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.username').textContent();
    const bio = await page.locator('.bio').textContent();
    const totalOrders = await page.locator('.stat:has-text("Orders") .stat-number').textContent();
    const totalReviews = await page.locator('.stat:has-text("Reviews") .stat-number').textContent();
    const sellerRating = await page.locator('.stat:has-text("Seller Rating") .stat-number').textContent();
    const profileImageUrl = await page.locator('.profile-image').getAttribute('src');

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      totalOrders: parseInt(totalOrders.trim(), 10),
      totalReviews: parseInt(totalReviews.trim(), 10),
      sellerRating: parseFloat(sellerRating.trim()),
      profileImageUrl
    };

    return {
      success: true,
      action: "Successfully navigated to the user profile page and harvested the user's information.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
